description:
The Seventh Volume of Sweetheart's acclaimed series two Finds Girls, Ash Hollywood and Allie Haze, on the run from A Dark Past and troubling. After their car breaks down, they meet Deauxma, a police detective and her lover Nina Hartley, a social worker. The older women seek to help the younger girls, only to find Allie anxious and fearful and Ash distrustful and defensive. These four characters are locked in a battle of wills as they pair off into passionate encounters, ultimately learning the truth, as the older women teach the younger girls the meaning of trust! Here you will find two girls, Ash Hollywood and Allie HEZ, on the run from dark and troubling past. After their car breaks down, they meet a Deauxma, a police detective and her lover Nina Hartley, a social worker. Older women are eager to help younger girls, only to find Allie troubling and fearful and suspicious Ash and protective. These four characters are locked in a battle of wills, as they pair up in a passionate encounter, eventually learning the truth, because the older women teach the younger girls the value of trust!

